import React from "react";
import styled from "styled-components";
const Aside = styled.aside`
  position: fixed;
  top: 50%;
  right: 73px;
  display: flex;
  flex-direction: column;

  & > button {
    font-size: 15px;
    font-weight: bold;
    background-color: unset;
    & > figure {
      width: 90px;
      height: 90px;
    }
  }
`;
function Side() {
  return (
    <Aside>
      <button>
        <figure>
          <img src="/assets/kakao.svg" alt="카카오" />
        </figure>
        <span>카카오톡 문의</span>
      </button>
      <button>
        <figure>
          <img src="/assets/naver.svg" alt="네이버" />
        </figure>
        <span>네이버 톡톡</span>
      </button>
    </Aside>
  );
}

export default Side;
